import React from 'react';
import ReactDOM from 'react-dom';

function Hello() {
  return (
  <div> 
    Hello 
    <strong> Muhammad Baqir!  </strong>

    <h3>List of fruits</h3>
    <ul>
      <li>Mango</li>
      <li>Orange</li>
      <li>Banana</li>
      <li>Water Melon</li>
    </ul>

  </div>
  );
}

ReactDOM.render(
  <Hello/>, document.querySelector('#root')
);
